import React from "react";

import Icon from "./icon"

export function Sidebar(props) {
  return (<div className="sidebar">
    <Icon homeIcon={props.homeIcon}  />
    <Icon logo={props.fireIcon}  />
    <Icon icons={props.subscriptionsIcon}  />
    <Icon icons={props.playlist}  />

  </div>)
}
